import React from "react";
import Typed from "react-typed";

const Hero = () => {
  return (
    <div className="text-white ">
      <div className="bg1 mt-[100] w-full h-screen mx-auto text-center flex flex-col justify-center ">
        <div className="absolute top-100 right-23 left- 10  bg-[#00df9a] p-4 rounded-md w-[500px]">
          <p className="font-bold text-white">
            We Crush Your Competitors, Goals, And Sales Records - Without The
            B.S.
          </p>
          <button className="bg-[#F28D35] w-[200px] rounded-md font-medium my-6 mx-auto py-3 text-black">
            GET FREE CONSULTATION
          </button>
        </div>

        <h1 className="text-4xl md:text-7xl sm:text-6xl md:py-6">
          Grow with data.
        </h1>
        <div className="mt-[100] mr-9-">
          <p className="py-4 text-xl font-bold md:text-5xl sm:text-4xl">
            Fast, flexible financing
          </p>
          <Typed
            className="pl-2 text-xl font-bold md:text-5xl sm:text-4xl md:pl-4"
            strings={["BTB", "BTC", "SASS"]}
            typeSpeed={120}
            backSpeed={140}
            loop
          />
        </div>
        <p className="text-xl font-bold text-gray-500 md:text-2xl">
          Monitor your data analytics to increase revenue for BTB, BTC & SASS
          platforms.
        </p>
      </div>
    </div>
  );
};

export default Hero;
